import React from "react";
import BookSession from "./BookSession";
import HomePageBanners from "../Templates/HomePageBanners";
import {fullScreenBanners, collapsingBanners} from "../../data/homePageData";

function Home() {
  return (
    <div>
      {fullScreenBanners.map((data, key) => (
        <HomePageBanners
          key={key}
          color={data.color}
          title={data.title}
          description={data.description}
          buttonText={data.buttonText}
          buttonLink={data.buttonLink}
          imageDescription={data.imageDescription}
          imageSrc={data.imageSrc}
        />
      ))}

      <div class="row">
        <div class="col-md-6">
          {collapsingBanners.map((data, key) => (
            <HomePageBanners
              key={key}
              color={data.color}
              title={data.title}
              description={data.description}
              buttonText={data.buttonText}
              buttonLink={data.buttonLink}
              videoSrc={data.videoSrc}
              imageDescription={data.imageDescription}
              imageSrc={data.imageSrc}
            />
          ))}
        </div>
        <div class="col-md-6">
          <BookSession />
        </div>
      </div>


      <Container fluid>
        {/* <Row> */}
        {/* <Col lg={2} className="d-none d-lg-block">
            <ServiceLinks />
          </Col> */}
        {/* <Col> */}
        <Row className="row justify-content-center">

              <Col lg={4} md={6} className="">

              </Col>

        </Row>
        <h2 className="display-4">Explore our most popular services</h2>
        <Row className="row justify-content-center mt-5">
          {servicesData.map((service, key) =>
            key < 2 ? (
              <Col
                md={5}
                className="mb-5 mx-4 shadow bg-white rounded font-weight-light"
              >
                <Card1
                  img={service.img}
                  className="blue-gradient service-card-img-taller"
                  title={service.name}
                  text={service.header}
                />
              </Col>
            ) : (
              ""
            )
          )}
        </Row>
        <hr />
        <Row>
          <Col className="">

          </Col>
        </Row>
        <hr />

        <Row>
              <Col lg={4} md={6} className="">

              </Col>

        </Row>
      </Container>

    </div>
  );
}

export default Home;
